import React from "react";
import {CardGroup, CardBody, CardTitle, Card, Table} from "reactstrap";

const card = (workout) => {
    return (
        <Card style={{textAlign: 'center'}}>
            <CardTitle >{workout.name}</CardTitle>
            <CardBody>
                <Table>
                    <thead>
                    <tr>
                        <th>Exercise</th>
                        <th>Reps</th>
                        <th>Sets</th>
                    </tr>
                    </thead>
                    <tbody>
                    {workout.exercises.map(e =>
                        <tr>
                        <td>{e.name}</td>
                        <td>{e.reps}</td>
                            <td>{e.sets}</td>
                    </tr>)}

                    </tbody>

                </Table>

            </CardBody>
        </Card>
    )

}

const cardStyleColumns = {
    display: 'flex', flexDirection: 'row', flex: 1
}

const cardStyle = {
    width: "20%",
    height: "300px",
    display: 'flex', flexDirection: 'row', borderRadius: '0%', margin: '2px',
    justifyContent: 'center',
    overflow: 'hidden'
}

const cardTitleStyle = {
    fontSize: '8px', wordWrap: 'break-word'
}


const WorkoutWeekTable = ({workouts}) => {
    return (
        <CardGroup>
            {workouts.map(workout => card(workout))}
        </CardGroup>
    )
};

export default WorkoutWeekTable;
